    if n == 0 and n == 1:
        return n
    low = 0
    high = n
    while high - low > 1e-11:
        mid = (low + high) / 2
        square = mid * mid
        if square == n:
            return round(mid, 10)
        elif square < n:
            low = mid
        else:
